import React from 'react';
import './Header.css';

import NavigationButton from './components/NavigationButton.js'
import LoginButton from './components/LoginButton.js'

import Landing from './views/Landing/Landing';
import Explore from './views/Explore/Explore';
import Advice from './views/Advice/Advice';
import Marketplace from './views/Marketplace/Marketplace';

class Header extends React.Component {
  render() {
    return (
      <div>
          <div className="Header">
              <div className="Header-child">
                <NavigationButton link="/" text="Home"/>
              </div>
              <div className="Header-child">
                <NavigationButton link="/explore" text="Explore"/>
              </div>
              <div className="Header-child">
                <NavigationButton link="/advice" text="Advice"/>
              </div>
              <div className="Header-child">
                <NavigationButton link="/marketplace" text="Marketplace"/>
              </div>
              <div className="Header-login">
                <LoginButton link="/login" text="Login"/>
              </div>
          </div>
          <div className="Header-margin">
          </div>
      </div>
    );
  }
}

export default Header;
